import { DoxJS } from "./index";

let dox = new DoxJS({
    array: [1, 2, 3],
    name: "DIMOS"
});



dox.subscribe(store => {
    let result = 0;
    for (let i = 0; i < store.array.length; i++) {
        result += store.array[i];
    }
    console.log(result);
});

let store = dox.observe();
store.array
store.array = [2, 3, 4];
store.array.push(1);
store.array.pop();
store.array.shift();
store.array.unshift(2);
store.array[0] = 0;
store.array = [2, 2, 2];
